// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.13;

contract Emitter {
    uint256 transactionCounter;
    mapping(bytes32 => bool) public transactions;

    event purchaseCredits(
        bytes32 indexed txHash,
        address from,
        uint amount,
        uint256 timestamp,
        uint256 end_date
    );

    struct emitterStruct {
        address emitterAdd;
        uint amount;
        uint256 timestamp;
        uint256 end_date;
    }

    emitterStruct[] emitterTransactions;

    function addToBlockChain(uint amount, uint256 end_date) public returns (bytes32) {
        transactionCounter += 1;
        emitterTransactions.push(
            emitterStruct(msg.sender, amount, block.timestamp, end_date)
        );

        bytes32 txHash = keccak256(abi.encodePacked(msg.sender, amount, block.timestamp, end_date));
        transactions[txHash] = true;

        emit purchaseCredits(txHash, msg.sender, amount, block.timestamp, end_date);
        return txHash;
    }

    function getAllTransactions() public view returns (emitterStruct[] memory) {
        return emitterTransactions;
    }

    function getTransactionCount() external view returns (uint256) {
        return transactionCounter;
    }

    function transactionExists(bytes32 txHash) public view returns (bool) {
        return transactions[txHash];
    }
}
